import { Link } from "react-router-dom";

function ProductsPage() {
  return (
    <>
      <h1>Products</h1>
      <ul>
        <li>
          <Link to="/products/product-1">A Book</Link>
        </li>
        <li>
          <Link to="/products/product-1">A Carpet</Link>
        </li>
        <li>
          <Link to="/products/product-1">An Online Course</Link>
        </li>
      </ul>
    </>
  );
}

export default ProductsPage;
